import React from "react";
import { Row, Container, Button, FormGroup, Input, Col } from "reactstrap";
const Form = () => {
    function Login () {
        console.log(values);
    }
    const { values, handleChange, handleSubmit } = useForm(login);
    return (
    <Container>
        <Row>
            <Col sm={6} className="mx-auto">
                <Form onSubmit={handleSubmit}>
                    <FormGroup>
                        <Input
                        type="text"
                        name="username"
                        onChange={handleChange}
                        value={values.username}
                        placeholder="Username"
                        required
                        />
                    </FormGroup>
                    <FormGroup>
                        <Input
                        type="password"
                        name="password"
                        onChange={handleChange}
                        value={values.password}
                        placeholder="Password"
                        required
                        />
                    </FormGroup>
                    <FormGroup>
                        <Button
                        type="submit"
                        className="button is-block is-info is-fullwidth"
                        >
                        Login
                        </Button>
                    </FormGroup>
            </Form>
          </Col>
        </Row>
    </Container>
    );
};
export default Form;
